import React from "react";
import usersData from "./usersData";

const Users = () => {

    const users = {
        user: usersData[0]
    }

    const infoUsers = (e) => {
        const Card = document.getElementsByClassName('Card');
    }

    return (
        <div>
            <button id='ButtonUsers' onClick={() => infoUsers(users[0])}>USERS</button>
            <div className="Card">
                <ul>
                    <li>{users[0].name}</li>
                    <li>{users[0].age}</li>
                    <li>{users[0].email}</li>
                </ul>
            </div>
        </div>
    );
}
export default Users;
